Сегодня ЗАО «Хлебокомбинат Петровский» является самым крупным производителем хлебобулочных изделий на территории Чувашской республики с объемом производства десятки тонн в сутки.
Наша специализация — производство традиционного русского хлеба с сочетанием вековых традиций классического хлебопечения и современных мировых технологий.
Наш хлеб приготовлен на артезианской воде, которая добывается на скважине №1/91 глубиной 175 метров.
Продукция от Петровского нарезана и упакована в красочную фирменную упаковку, что позволяет продукту не терять своих полезных свойств, - хлеб остается свежим и вкусным от печи до дома.
Продукция Петровского хлебокомбината это:
опыт и традиции классического хлебопечения (печем хлеб c 1960 г.);
современное европейское оборудование (с 2012 года инвестировано сотни миллионов рублей);
качественные ингредиенты и собственная артезианская скважина (глубина 175 м.);
без консервантов, органическая и экологически чистая продукция.
Соблюдение правильности технологии производства, ежедневный контроль качества выпускаемой продукции, применение чистых культур и компонентов позволяют изготавливать вкусный и полезный хлеб.

Муниципальное дорожно-эксплуатационное предприятие муниципального образования город Ханты-Мансийск оказывает следующие платные услуги:

-Сбор и  транспортирование отходов IV, V класса опасности за исключение ТКО;
-Размещение отходов IV, V класса опасности за исключение ТКО;
-Сбор, транспортирование и обезвреживание ртутных люминесцентных, энергосберегающих ламп;
-Сбор, транспортирование и обезвреживание термометров медицинских;
-Сбор, транспортирование и обезвреживание термометров лабораторных;
-Размещение снежных масс с последующим плавлением;
-Сбор, транспортирование и обезвреживание масла отработанного;
-Размещение биологических отходов;
-Сбор и обезвреживание производственных отходов, в том числе нефтесодержащих с применением установки "Форсаж";
-Сбор, транспортирование, обработка и утилизация обработанных покрышек, шин и камер (отходов IV класса опасности);
- Утилизация биологических отходов;
- Отлов бродячих животных;
- Сдача техники в аренду;
- Услуги автомойки;
- Нанесение дорожной разметки;
- Установка дорожных знаков;
- Устройство асфальтобетонного покрытия;
- Спиливание деревьев.

ВОЛМА – федеральная производственная компания. Система менеджмента качества соответствует международному стандарту ISO 9001:2015 Развивается на рынке строительно-отделочных материалов с 1943 года. Основная специализация: добыча природного гипсового камня на собственных месторождениях и производство строительно-отделочных материалов на гипсовой, а также цементной основе. ВОЛМА сегодня лидирует в России и странах таможенного союза:
№1 на рынке пазогребневых плит / ПГП в РФ и ЕАЭС);

№2 на рынке гипсокартонных листов / ГКЛ в РФ и ЕАЭС;

№2 на рынке гипсовых сухих строительных смесей в РФ и ЕАЭС.

ВОЛМА - одна из первых компаний на рынке механизированных технологий строительно-отделочных работ.
Мы продвигаем решения по оштукатуриванию, шпаклеванию и устройству полов с использованием машинных станций уже более 15 лет.

ООО «Газпром газораспределение Томск» - газораспределительная организация (ГРО) на территории Сибирского Федерального округа в Томской, Кемеровской, Новосибирской, Иркутской областях и в Республике Алтай, осуществляет

- техническую эксплуатацию газораспределительных сетей общей протяженностью более 6898 км;
- транспортировку природного газа на 2775 объектов коммунально-бытового комплекса, 970 промышленных предприятий, 120 сельскохозяйственных объектов, а также физическим лицам во всех регионах присутствия; общий объем транспортировки природного газа составляет 5,793 млрд м3  в год;
- техническое, аварийно-диспетчерское обслуживание и ремонт внутридомового газового оборудования более 108,97 тысяч газифицированных квартир и домовладений;
- строительство газораспределительных сетей  и газификацию жилых домов и квартир в регионах присутствия Общества.

ООО «Газпром газораспределение Томск» участвует в реализации Программы газификации регионов РФ ПАО «Газпром», Программ газификации за счет средств специальной надбавки к тарифу на услуги по транспортировке газа, выполняет строительство, реконструкцию и техническое перевооружение объектов системы газораспределения в субъектах Сибирского Федерального округа - Иркутской, Кемеровской, Новосибирской, Томской областях и в Республике Алтай.
